INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES ("あたしだって\nやるときはやるよ！", 10040, 24001, 0.0, 1, 102601, 24, 1, "リン", 0.0, "2020/04/30 12:00:00", 0.0, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES ("ふぅ…\nこれであたしの仕事は\n終わりだね", 10040, 24002, 0.0, 1, 102601, 24, 1, "リン", 0.0, "2020/04/30 12:00:00", 0.0, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES ("終わった終わった\n一人でもなんとか\nなるもんだね", 10040, 24003, 0.0, 1, 102601, 24, 1, "リン", 0.0, "2020/04/30 12:00:00", 0.0, 2, "2030/12/17 14:59:59");
INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES ("やったね！\nこれでようやく\nサボれるよ…", 10040, 24004, 0.0, 2, 102601, 24, 2, "リン", 0.0, "2020/04/30 12:00:00", 0.0, 3, "2030/12/17 14:59:59");
INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES ("チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 10040, 24005, 0.0, 1, 102601, 24, 1, "リン", 0.0, "2020/04/30 12:00:00", 0.0, 4, "2030/12/17 14:59:59");
INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES ("あたしを敵に回した\n恐ろしさ\n思い知ったか！", 10040, 24006, 0.0, 2, 102601, 24, 2, "リン", 0.0, "2020/04/30 12:00:00", 0.0, 5, "2030/12/17 14:59:59");
INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES ("あたしも意外と\nやるもんでしょ？", 10040, 24007, 0.0, 2, 102601, 24, 2, "リン", 0.0, "2020/04/30 12:00:00", 0.0, 6, "2030/12/17 14:59:59");
INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES ("疲れた…\nねずみの逃げ足\n速すぎるよ…", 10040, 24008, 0.0, 4, 102601, 24, 4, "リン", 0.0, "2020/04/30 12:00:00", 0.0, 7, "2030/12/17 14:59:59");
INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES ("このままじゃ\nまっひ～に\n叱られちゃうよ", 10040, 24009, 0.0, 4, 102601, 24, 4, "リン", 0.0, "2020/04/30 12:00:00", 0.0, 8, "2030/12/17 14:59:59");
INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES ("まじめに\nやったんだけどな…\n悔しいな～", 10040, 24010, 0.0, 4, 102601, 24, 4, "リン", 0.0, "2020/04/30 12:00:00", 0.0, 9, "2030/12/17 14:59:59");
INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES ("やられた…\nねずみって意外と\nてごわいね", 10040, 24011, 0.0, 4, 102601, 24, 4, "リン", 0.0, "2020/04/30 12:00:00", 0.0, 10, "2030/12/17 14:59:59");
INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES ("おのれ～\nあたしのチーズを\n盗みやがって～！", 10040, 24012, 0.0, 4, 102601, 24, 4, "リン", 0.0, "2020/04/30 12:00:00", 0.0, 11, "2030/12/17 14:59:59");
INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES ("疲れた…\nけど、次こそは\n守り抜くよ…", 10040, 24013, 0.0, 1, 102601, 24, 4, "リン", 1.81, "2020/04/30 12:00:00", 0.0, 12, "2030/12/17 14:59:59");
